/*===About this script===
This will add a layer to the layers menu which, when enabled, will create an overlay on the map.

Based off davielde's WME countyborder Overlay
Data from TDEC was simplified in QGIS using a tolerance of 12 to fit within the limits imposed by Greasyfork. Original data is linked from my userspace: https://wiki.waze.com/wiki/User:Super_D
*/



function bootstrap_cityborderOverlay()
{
 var bGreasemonkeyServiceDefined = false;

 try {
 bGreasemonkeyServiceDefined = (typeof Components.interfaces.gmIGreasemonkeyService === "object");
 }
 catch (err) { /* Ignore */ }

 if (typeof unsafeWindow === "undefined" || ! bGreasemonkeyServiceDefined) {
 unsafeWindow = ( function () {
 var dummyElem = document.createElement('p');
 dummyElem.setAttribute('onclick', 'return window;');
 return dummyElem.onclick();
 }) ();
 }

 /* begin running the code! */
 setTimeout(InitcityborderOverlay, 1000);
}

function AddcityPolygon(cityLayer,groupPoints,groupColor,groupNumber){
 
 var mro_Map = unsafeWindow.Waze.map;
 var mro_OL = unsafeWindow.OpenLayers;
 var cityGroupLabel = groupNumber;
 var groupName = groupNumber;
 
 var style = {
 strokeColor: groupColor,
 strokeOpacity: 0.85,
 strokeWidth: 1,
 fillColor: groupColor,
 fillOpacity: 0.35,
 label: cityGroupLabel,
 labelOutlineColor: "black",
 labelOutlineWidth: 1,
 fontSize: 16,
 fontColor: "red",
 fontOpacity: 0.85,
 fontWeight: "bold" 
 };
 
 var attributes = {
 name: groupName,
 number: groupNumber
 };
 
 var pnt= [];
 for(i=0;i<groupPoints.length;i++){
 convPoint = new OpenLayers.Geometry.Point(groupPoints[i].lon,groupPoints[i].lat).transform(new OpenLayers.Projection("EPSG:4326"), mro_Map.getProjectionObject());
 //console.log('cityborder: ' + JSON.stringify(groupPoints[i]) + ', ' + groupPoints[i].lon + ', ' + groupPoints[i].lat);
 pnt.push(convPoint);
 }
		 
 var ring = new mro_OL.Geometry.LinearRing(pnt);
 var polygon = new mro_OL.Geometry.Polygon([ring]);
 
 var feature = new mro_OL.Feature.Vector(polygon,attributes,style);
 cityLayer.addFeatures([feature]);

}

function CurrentcityLocation(city_mapLayer){
 var mro_Map = unsafeWindow.Waze.map;

 for(i=0;i<city_mapLayer.features.length;i++){
 var cityMapCenter = mro_Map.getCenter();
 var cityCenterPoint = new OpenLayers.Geometry.Point(cityMapCenter.lon,cityMapCenter.lat);
 var cityCenterCheck = city_mapLayer.features[i].geometry.components[0].containsPoint(cityCenterPoint);
 //console.log('cityborder: ' + city_mapLayer.features[i].attributes.number + ': ' + cityCenterCheck);
 if(cityCenterCheck === true){
 var cityLocationLabel =$('.WazeControlLocationInfo').text() + ' [' + city_mapLayer.features[i].attributes.number + ']';
 		setTimeout(function(){$('.WazeControlLocationInfo').text(cityLocationLabel);},200);
 }
 }
}

